IF OBJECT_ID('dbo.proc_transform_146', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_146;
GO
CREATE PROCEDURE dbo.proc_transform_146
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_146
    SET payload = LEFT(payload, 1000) + N'|V4-146|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_146;
END
